window.bookSummaryJSON = "<p>I finally made it out of the Dark Woods only to learn that Sawyer is in prison, our people are still at war, and the wolves are hiding underground. It will take every ounce of strength I have in order to save our people, get my man back, and bring down the queen.</p> <p>I can't do this alone, and calling on an old friend proves to be the best decision I could ever make. Nothing will keep me from my mate, not even the magical world's most high security prison.</p> <p>You will love the twists and turns in this epic conclusion to the best-selling Wolf Girl series!</p>"; 
